def recPrt(cont,tabs):
	opStr = ""
	tfCapConverter={True:"true",False:"false"}
	commas = False
	if type(cont)==dict or type(cont)==list:
		opStr+= "\n"+"\t"*tabs 
		opStr+="{\n" if type(cont)==dict else "[\n"		
		tabs +=1
		for k in cont:
			if commas:
				opStr +=","
			else:
				commas = True
			opStr += "\n"+"\t"*tabs
			opStr += '"'+(str(k)+'"'+":"+recPrt(cont[k],tabs+1)) if type(cont)==dict else recPrt(k,tabs+1)			
		tabs -=1
		opStr += "\n"+"\t"*tabs
		opStr+="}" if type(cont)==dict else "]"
	elif type(cont)==int or type(cont)==float:
		opStr+=str(cont)
	elif type(cont)==bool:
		opStr+=tfCapConverter[cont]
	elif cont == None:
		opStr+="null"
	else:
		opStr+='"'+str(cont)+'"'
	return(opStr)
def PrettyNest(obj):
	return(recPrt(obj,0))

